{"translationLines":[{"lineNumber":50571,"originalJapaneseLine":"「ほんとだー委員長だ。","translatedEnglishLine":"\"It's true—the class president!\""},{"lineNumber":50572,"originalJapaneseLine":"　ねえねえ委員長、何か言ってみて","translatedEnglishLine":"\"Hey, hey, class president, say something!\""},{"lineNumber":50573,"originalJapaneseLine":"「あっ……あなたたち、何ふざけてるの！","translatedEnglishLine":"\"Ah... you guys, what are you fooling around with!\""},{"lineNumber":50574,"originalJapaneseLine":"　戦争中なのよ！　早く戦場に行きなさい！」","translatedEnglishLine":"We're at war! Hurry up and go to the battlefield!\""},{"lineNumber":50575,"originalJapaneseLine":"「きゃー、叱られたー」","translatedEnglishLine":"\"Eek, we got scolded!\""},{"lineNumber":50576,"originalJapaneseLine":"「パーフェクツ……！　やっぱり委員長だー」","translatedEnglishLine":"\"Perfects...! As expected of the class president!\""},{"lineNumber":50577,"originalJapaneseLine":"「くっ……！」","translatedEnglishLine":"\"Gah...!\""},{"lineNumber":50578,"originalJapaneseLine":"きゃーきゃーと喜ぶハニー。","translatedEnglishLine":"Honey cheered joyfully with squeals."},{"lineNumber":50579,"originalJapaneseLine":"「マジック、いきましょう。","translatedEnglishLine":"\"Magic, let's go."},{"lineNumber":50580,"originalJapaneseLine":"　気にせずほっときなさい」","translatedEnglishLine":"Ignore it and leave them alone.\""},{"lineNumber":50581,"originalJapaneseLine":"「う、うん、そうだけど……」","translatedEnglishLine":"\"Y-yeah, that's true, but...\""},{"lineNumber":50582,"originalJapaneseLine":"「あっ、こっちの人はすごい格好。","translatedEnglishLine":"\"Ah, this person over here is dressed amazingly."},{"lineNumber":50583,"originalJapaneseLine":"　悪の女幹部だね」","translatedEnglishLine":"An evil female executive, huh.\""},{"lineNumber":50584,"originalJapaneseLine":"「ほんとだ！　オーッホッホッホって笑いそう。","translatedEnglishLine":"\"It's true! She looks like she'd laugh 'Oo-ho-ho-ho.'"},

{"lineNumber":50585,"originalJapaneseLine":"　鞭使うのかな、どきどき","translatedEnglishLine":"I wonder if she'll use a whip, exciting."},

{"lineNumber":50586,"originalJapaneseLine":"「なぁんですってぇ！」","translatedEnglishLine":"\"Whaaat did you say!\""},{"lineNumber":50587,"originalJapaneseLine":"「………………」","translatedEnglishLine":"\"........\""},{"lineNumber":50588,"originalJapaneseLine":"「アニス、","translatedEnglishLine":"\"Anise,"},{"lineNumber":50589,"originalJapaneseLine":"　構わないから全部吹っ飛ばしてきなさい！」","translatedEnglishLine":"Don't worry about it, just blow them all away!\""},{"lineNumber":50590,"originalJapaneseLine":"「えっ、いいんですか？　やったー」","translatedEnglishLine":"\"Eh, is that okay? Yay!\""},{"lineNumber":50591,"originalJapaneseLine":"「きゃーーーっ」","translatedEnglishLine":"\"Kyaaaa!\""},{"lineNumber":50592,"originalJapaneseLine":"多少の混乱を引き起こしながら、","translatedEnglishLine":"Causing some confusion,"},{"lineNumber":50593,"originalJapaneseLine":"ゼス軍が戦線に加わった。","translatedEnglishLine":"the ZESS army joined the front lines."},{"lineNumber":50594,"originalJapaneseLine":"「が、ぐ、ぐぎぎぎ……！」","translatedEnglishLine":"\"G-g-grrggh...!\""},{"lineNumber":50595,"originalJapaneseLine":"次々と入ってくる、ハニー軍団からの被害報告に、","translatedEnglishLine":"At the continuous incoming damage reports from the Honey corps,"},{"lineNumber":50596,"originalJapaneseLine":"ツォトンの怒りは頂点に達しようとしていた。","translatedEnglishLine":"Tsoton's anger was about to reach its peak."},{"lineNumber":50597,"originalJapaneseLine":"「あの！　あの畜生陶器どもが！","translatedEnglishLine":"\"Those! Those damned pottery creatures!"},{"lineNumber":50598,"originalJapaneseLine":"　何をいきなりとち狂ったのだ！？」","translatedEnglishLine":"What the hell suddenly made them go crazy!?\""},{"lineNumber":50599,"originalJapaneseLine":"「そ、それがまったく……」","translatedEnglishLine":"\"W-well, that's exactly..."},{"lineNumber":50600,"originalJapaneseLine":"「ニィハオな顔で歓待してやったというのに……！","translatedEnglishLine":"We welcomed them with a big 'Nihao' face...!"},{"lineNumber":50601,"originalJapaneseLine":"　この私を、道化にしてくれたな！」","translatedEnglishLine":"They've made a fool out of me!"},{"lineNumber":50602,"originalJapaneseLine":"「い、いかがしますか、大将軍閣下……！」","translatedEnglishLine":"\"W-what shall we do, Great General Lord...?\""},{"lineNumber":50603,"originalJapaneseLine":"「言われずとも分かるだろうが！　叩き潰せ！","translatedEnglishLine":"\"You should know without being told! Crush them!"},{"lineNumber":50604,"originalJapaneseLine":"　数では勝っているだろう！」","translatedEnglishLine":"We outnumber them, after all!\""},{"lineNumber":50605,"originalJapaneseLine":"「は、ははっ……」","translatedEnglishLine":"\"Hahaha...\""},{"lineNumber":50606,"originalJapaneseLine":"そこに、新たな伝令が飛び込んできた。","translatedEnglishLine":"At that moment, a new messenger rushed in."},{"lineNumber":50607,"originalJapaneseLine":"「申し上げます！","translatedEnglishLine":"\"I report!"},{"lineNumber":50608,"originalJapaneseLine":"　人間どもの部隊が現れ、攻めてきました！」","translatedEnglishLine":"Human forces have appeared and attacked!\""},{"lineNumber":50609,"originalJapaneseLine":"「なんだと！？　何故、今なのだ！」","translatedEnglishLine":"\"What!? Why now!\""},{"lineNumber":50610,"originalJapaneseLine":"「分かりませんが……ハニーと共闘している模様！","translatedEnglishLine":"\"I don't know, but... they seem to be cooperating with Honey!"},{"lineNumber":50611,"originalJapaneseLine":"　数はおよそ6000ほどですが……」","translatedEnglishLine":"Their numbers are about six thousand, though...\""},{"lineNumber":50612,"originalJapaneseLine":"「潰せるだろう、それっぽっちの数！」","translatedEnglishLine":"\"We can crush that paltry number!\""},{"lineNumber":50613,"originalJapaneseLine":"「それが……劣勢です！","translatedEnglishLine":"\"However... we are at a disadvantage!"},{"lineNumber":50614,"originalJapaneseLine":"　ハニー達の後ろから、ハニーを巻き添えにするのを","translatedEnglishLine":"From behind Honey and the others, unwilling to hold back,"},{"lineNumber":50615,"originalJapaneseLine":"　構わず、強力な魔法を撃ち込んできて……！」","translatedEnglishLine":"they blasted powerful magic that even takes Honey with it...!\""},{"lineNumber":50616,"originalJapaneseLine":"「ぬ、ぐぬ、ぐぬぬぬ……！」","translatedEnglishLine":"\"Ngh, grr, grrrr...!\""},{"lineNumber":50617,"originalJapaneseLine":"怒鳴り散らしたくなる衝動を抑え、","translatedEnglishLine":"Suppressing the urge to shout angrily,"},{"lineNumber":50618,"originalJapaneseLine":"ツォトンは頭の冷静な部分で思案した。","translatedEnglishLine":"Tsoton thought with his calm mind."},{"lineNumber":50619,"originalJapaneseLine":"「…………撤退する、か……」","translatedEnglishLine":"\"...Shall we retreat...\""},{"lineNumber":50620,"originalJapaneseLine":"「は……退かれるのでありますか」","translatedEnglishLine":"\"Ha... are we going to retreat?\""}]}

